import React from 'react';



export default class Selector extends React.Component {



    render(){
        return(


        <select onChange= {(e) => onChangeLey(e.target.value)}>
          <option value="0">MyStore</option>
          <option value="1">YourStore</option>          
        </select>


        );
    }
}
